  the second part is (C1-C2*x)*sin(pi*x/w) w is the semi-periods of sin wave
  the third part is C*sin(pi*x/w) w is the semi-periods of sin wave
  the fourth part is (C1-C2*x)*sin(pi*x/w) w is the semi-periods of sin wave

for(int i=0;i<N;i++) {
			float p = C*i;
			double div = Math.PI/wf;
			int result = (int) (p*Math.sin(i*div));
			String hex = Integer.toHexString(result);
			while(hex.length()<8) {
				hex = "0"+hex;
			}
			System.out.print("0x"+hex.substring(4,8)+",");
}

for(int i=N;i<M;i++) {
			float p = (-C1)*(i-C2);
