			System.out.print("0x"+hex.substring(4,8)+",");
}
		
for(int i=O;i<=P;i++) {
			float p = (-C1)*(i-C2);
			double div = Math.PI/wf;
			int result = (int)(p*Math.sin(i*div));
			String hex = Integer.toHexString(result);
			while(hex.length()<8) {
				hex = "0"+hex;
			}
			System.out.print("0x"+hex.substring(4,8)+",");
}
